import React from 'react';
import './About.css';

function About() {
    return (
        <React.Fragment>
            <div
                className='center black bl bb br3 w-10'>
            <h1>About</h1>
            </div>

            <div>
                <p>ToDoList app v1</p>
            </div>
        </React.Fragment>
    )
}

export default About
